import "../App.css"
import * as React from "react";

function Header() {
    return <div>
        <p className="header-title">MyClinic</p>
    </div>
}

function HomeContent() {
    return <div>
        <p className="tagline-title">Wait in Comfort!</p>
        <p>We will call you when it's ready!</p>
    </div>
}

export {HomeContent, Header};
